import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Hero from '../components/Hero';

function Register() {
  return (
    <>
        <Navbar/>
        <Hero
            cName = "hero-about"
            heroImg = {"https://cdn.theatlantic.com/thumbor/wUBpzEY-G6JI_CbKa0wsWbd4oFA=/549x0:2576x2027/1080x1080/media/img/mt/2017/02/AP_333299457394/original.jpg"}
            title = "Register Account"
            text = "In order to start booking for your ideal accomodation, you need to register an account"
        />
        <Footer/>
    </>
  )
}

export default Register
